@font-face {

}

* {
  box-sizing: border-box;
}

html {
  font-size: 1.6vmax;
}

body {
  background-image: linear-gradient(top, #18181B, #202026);

  line-height: 1.8;
  color: #222;
  margin: 0;
}

#header {
  height: 50vh;
  position: relative;
  background: transparent;
}

#header .bottom {
  left: 0;
  right: 0;
  position: absolute;
  bottom: 0;
}

#header h1, #header h2 {
  color: #fff;
}

#header h1 small, #header h2 small {
  opacity: 0.8;
}

#footer {
  height: 100vh;
}

#stars {
  height: 100%;
  width: 100%;
  left: 0;
  top: 0;
  z-index: -1;
  position: fixed;
}

.star {
  stroke-width: 0;
}

#conner {
  animation: float-animation 4s infinite alternate;
  -webkit-animation: float-animation 4s infinite alternate;
  background-image: url(images/conner.png);
  background-size: contain;
  background-repeat: no-repeat;
  left: 65vw;
  top: 20vh;
  height: 7rem;
  width: 7rem;
  z-index: -1;
  position: fixed;
}

#laptop {
  animation: float-animation 4s infinite alternate 2s;
  -webkit-animation: float-animation 4s infinite alternate 2s;
  background-image: url(images/laptop.png);
  background-size: contain;
  background-repeat: no-repeat;
  left: 58vw;
  top: 14vh;
  height: 7rem;
  width: 7rem;
  z-index: -1;
  position: fixed;
}

#content {
  padding: 2rem 0;
  background: #fff;
}

.container {
  margin: 0 auto;
  padding: 0 1rem;
  max-width: 36rem;
}

h1, h2, h3, h4 {
  margin: 0;
}

pre {
  background: #202026;
}

code {

  padding: 0.7em;

}

.hljs-built_in {
  font-weight: bold;
  color: #fff;
}

.hljs-attribute {
  color: #89BDFF;
}

.hljs-string {
